import { useEffect, useState } from 'react'
import TraineeCard from './TraineeCard'
import axios from 'axios'


const ListTrainees = () => {

    const [traineeList, setTraineeList] = useState([])
    const api = "http://localhost:8088/api/v1/trainee"

    const loadTrainees = () => {
        axios.get(api)
            .then(response => {setTraineeList(response.data) })
            .catch(error => { console.log('unable to load data') })
    }

    useEffect(() => { 
        loadTrainees() 
    },[]);

    return (
        <div>
            {
                traineeList.map(
                    trainee => <TraineeCard key={trainee.id} trainee={trainee} />
                )
            }

    
        </div>
    )
}

export default ListTrainees
